import React from 'react'
// import { useSelector } from 'react-redux'
import { Link } from 'react-router-dom'
import {
  Paper,
  TableContainer,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody } from '@material-ui/core'

const Users = ({ users }) => {
  // const [users, setUsers] = useState()
  // const blogs = useSelector(state => state.blogs)
  // let users = []

  // blogs.forEach(blog => {
